import React from 'react';
import Link from 'next/link';

import { Text } from './styles';

const Custom404 = () => {

  return (
    <>
      <Text>This page not found</Text>
      <Link href='/home'>
        <a >Back to Home Page</a>
      </Link>


    </>
  );
};


export default Custom404;
